text:
b'Dekat juga tak masalah;
Jauh pun tak mengapa;
Asal di hatimu, aku betah;
Dekat selalu juga tak baik;
Jauh melulu pun berat kutanggung rindu;
Asal saling menjaga janji, hati kita yang tetap saling;
Bagaimana?

-@Nunukwijayanti9'

b'Jangan pergi,
Jika masih ingin kembali;

Dan jangan pernah kembali,
Bila memang inginkan pergi;

Langkah cinta, 
Tak sebercanda lara;

Pun goresan luka:
Tak selucu tawa, Kekasih.

- @SastrawanEdan'
